
CREATE TABLE `stadion` (
  `id_stadionu` int(11) NOT NULL AUTO_INCREMENT,
  `nazwa` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `adres` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `pojemnosc` int(11) NOT NULL,
  `parking` varchar(1) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_stadionu`),
  UNIQUE KEY `stadion_nazwa_un` (`nazwa`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `znicz` (
  `id_znicza` int(11) NOT NULL AUTO_INCREMENT,
  `nazwa` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `masa` float NOT NULL,
  `predkosc` float NOT NULL,
  `producent` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_znicza`),
  UNIQUE KEY `znicz_nazwa_un` (`nazwa`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `druzyna` (
  `id_druzyny` int(11) NOT NULL AUTO_INCREMENT,
  `nazwa` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `narodowosc` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL,
  `stadion_id_stadionu` int(11) NOT NULL,
  PRIMARY KEY (`id_druzyny`),
  UNIQUE KEY `druzyna_nazwa_un` (`nazwa`),
  KEY `druzyna_stadion_fk` (`stadion_id_stadionu`),
  CONSTRAINT `druzyna_stadion_fk` FOREIGN KEY (`stadion_id_stadionu`) REFERENCES `stadion` (`id_stadionu`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `zawodnik` (
  `id_zawodnika` int(11) NOT NULL AUTO_INCREMENT,
  `imie` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `nazwisko` varchar(64) COLLATE utf8_unicode_ci NOT NULL,
  `pozycja` varchar(16) COLLATE utf8_unicode_ci NOT NULL,
  `data_urodzenia` date NOT NULL,
  `plec` varchar(1) COLLATE utf8_unicode_ci NOT NULL,
  `druzyna_id_druzyny` int(11) NOT NULL,
  PRIMARY KEY (`id_zawodnika`),
  KEY `zawodnik_druzyna_fk` (`druzyna_id_druzyny`),
  CONSTRAINT `zawodnik_druzyna_fk` FOREIGN KEY (`druzyna_id_druzyny`) REFERENCES `druzyna` (`id_druzyny`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `sedzia` (
  `id_sedzi` int(11) NOT NULL AUTO_INCREMENT,
  `imie` varchar(16) COLLATE utf8_unicode_ci NOT NULL,
  `nazwisko` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `data_urodzenia` date DEFAULT NULL,
  PRIMARY KEY (`id_sedzi`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `rozgrywka` (
  `id_rozgrywki` int(11) NOT NULL AUTO_INCREMENT,
  `punkty_druzyna1` int(11) DEFAULT NULL,
  `punkty_druzyna2` int(11) DEFAULT NULL,
  `data` date NOT NULL,
  `druzyna_id_druzyny1` int(11) NOT NULL,
  `druzyna_id_druzyny2` int(11) NOT NULL,
  `znicz_id_znicza` int(11) NOT NULL,
  `sedzia_id_sedzi` int(11) NOT NULL,
  PRIMARY KEY (`id_rozgrywki`),
  KEY `rozgrywka_druzyna_fk1` (`druzyna_id_druzyny1`),
  KEY `rozgrywka_druzyna_fk2` (`druzyna_id_druzyny2`),
  KEY `rozgrywka_sedzia_fk` (`sedzia_id_sedzi`),
  KEY `rozgrywka_znicz_fk` (`znicz_id_znicza`),
  CONSTRAINT `rozgrywka_druzyna_fk1` FOREIGN KEY (`druzyna_id_druzyny1`) REFERENCES `druzyna` (`id_druzyny`),
  CONSTRAINT `rozgrywka_druzyna_fk2` FOREIGN KEY (`druzyna_id_druzyny2`) REFERENCES `druzyna` (`id_druzyny`),
  CONSTRAINT `rozgrywka_sedzia_fk` FOREIGN KEY (`sedzia_id_sedzi`) REFERENCES `sedzia` (`id_sedzi`),
  CONSTRAINT `rozgrywka_znicz_fk` FOREIGN KEY (`znicz_id_znicza`) REFERENCES `znicz` (`id_znicza`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `kara` (
  `id_kary` int(11) NOT NULL AUTO_INCREMENT,
  `typ_kary` varchar(16) COLLATE utf8_unicode_ci NOT NULL,
  `okres_wykluczenia` int(11) NOT NULL,
  `zawodnik_id_zawodnika` int(11) NOT NULL,
  PRIMARY KEY (`id_kary`),
  KEY `kara_zawodnik_fk` (`zawodnik_id_zawodnika`),
  CONSTRAINT `kara_zawodnik_fk` FOREIGN KEY (`zawodnik_id_zawodnika`) REFERENCES `zawodnik` (`id_zawodnika`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `pracownik` (
  `id_pracownika` int(11) NOT NULL AUTO_INCREMENT,
  `imie` varchar(16) COLLATE utf8_unicode_ci NOT NULL,
  `nazwisko` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `funkcja` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `zarobki` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_pracownika`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `relation_9` (
  `id_rel` int(11) NOT NULL AUTO_INCREMENT,
  `pracownicy_id_pracownika` int(11) NOT NULL,
  `druzyna_id_druzyny` int(11) NOT NULL,
  PRIMARY KEY (`id_rel`),
  KEY `relation_9_druzyna_fk` (`druzyna_id_druzyny`),
  KEY `relation_9_pracownicy_fk` (`pracownicy_id_pracownika`),
  CONSTRAINT `relation_9_druzyna_fk` FOREIGN KEY (`druzyna_id_druzyny`) REFERENCES `druzyna` (`id_druzyny`),
  CONSTRAINT `relation_9_pracownicy_fk` FOREIGN KEY (`pracownicy_id_pracownika`) REFERENCES `pracownik` (`id_pracownika`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE `miotla` (
  `id_miotly` int(11) NOT NULL AUTO_INCREMENT,
  `model` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `predkosc` float DEFAULT NULL,
  `tworzywo` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL,
  `masa` float NOT NULL,
  `kolor` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL,
  `zawodnik_id_zawodnika` int(11) NOT NULL,
  PRIMARY KEY (`id_miotly`),
  KEY `miotla_zawodnik_fk` (`zawodnik_id_zawodnika`),
  CONSTRAINT `miotla_zawodnik_fk` FOREIGN KEY (`zawodnik_id_zawodnika`) REFERENCES `zawodnik` (`id_zawodnika`)
) ENGINE=InnoDB AUTO_INCREMENT=10001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

